import React from 'react';


export const useFetch = (url) => {
    const [response, setResponse] = React.useState({});

    React.useEffect(() => {
      const fetchData = async () => {
          const res = await fetch(url);
          const json = await res.json();
          setResponse(json);
      };
      fetchData();
    }, []);

    return response;
};
